function makeMovableDiv(div){
    const currentDiv = document.querySelector(div);
    var oldPageX;
    var oldPageY;
    var flag = 1;
    currentDiv.addEventListener('mousedown', function(e) {
        flag = 1;
        if(currentDiv.getBoundingClientRect().left + 5 > e.pageX){
            flag = 2;
        }
        if(currentDiv.getBoundingClientRect().top + 5 > e.pageY){
            flag = 2;
        }
        if(currentDiv.getBoundingClientRect().top + currentDiv.getBoundingClientRect().height - 5 < e.pageY - $(window).scrollTop()){
            flag = 2;
        }
        if(currentDiv.getBoundingClientRect().left + currentDiv.getBoundingClientRect().width - 5 < e.pageX- $(window).scrollLeft()){
            flag = 2;
        }
        if (flag == 1)
        {
            oldPageX = e.pageX + $(window).scrollLeft()
            oldPageY = e.pageY + $(window).scrollTop()
            e.preventDefault();
            window.addEventListener('mousemove', move);
            window.addEventListener('mouseup', stopMove);
        }
    })
    function move(e) {
        if (currentDiv.classList.contains('resizable')) {
            document.querySelector('.theme-blue').style.cursor = "move";
            var diffPageX = e.pageX - oldPageX + $(window).scrollLeft();
            var diffPageY = e.pageY - oldPageY + $(window).scrollTop();
            var oldDivLeft = currentDiv.getBoundingClientRect().left;
            var oldDivTop = currentDiv.getBoundingClientRect().top;
            $(currentDiv).css("left", oldDivLeft + diffPageX + $(window).scrollLeft() + "px");
            $(currentDiv).css("top", oldDivTop + diffPageY + $(window).scrollTop() + "px");
            oldPageX = e.pageX + $(window).scrollLeft()
            oldPageY = e.pageY + $(window).scrollTop();
            refresh();
        }
    }

    function stopMove() {
        document.querySelector('.theme-blue').style.cursor = "auto";
        window.removeEventListener('mousemove', move);
    }
}
