function makeResizableDiv(div) {
    const element = document.querySelector(div);
    const resizers = document.querySelectorAll(div + ' .resizer')
    for (let i = 0;i < resizers.length; i++) {
        const currentResizer = resizers[i];
        currentResizer.addEventListener('mousedown', function(e) {
            if (isNaN(drate)) {
                drate = element.getBoundingClientRect().height / element.getBoundingClientRect().width;
            }
            e.preventDefault();
            window.addEventListener('mousemove', resize);
            window.addEventListener('mouseup', stopResize);
        });
        function resize(e) {
            if (currentResizer.classList.contains('bottom-right')) {
                document.querySelector('.theme-blue').style.cursor = "nwse-resize";
                var oldWidth = element.getBoundingClientRect().width;
                var oldHeight = element.getBoundingClientRect().height;
                var newWidth = e.pageX - element.getBoundingClientRect().left
                var newHeight = e.pageY - element.getBoundingClientRect().top
                var diffWidth = newWidth - oldWidth;
                var diffHeight = newHeight - oldHeight;
                var min = Math.min(diffHeight, diffWidth);
                if (min == diffWidth)
                {
                    if (newWidth < 20)
                        newWidth = 20;
                    element.style.width = newWidth + 'px';
                    element.style.height = newWidth * drate + 'px';
                }else
                {
                    if (newHeight < 20)
                        newHeight = 20 * drate;
                    element.style.width = newHeight / drate + 'px';
                    element.style.height = newHeight + 'px';
                }
            }else if (currentResizer.classList.contains('top-right')) {
                document.querySelector('.theme-blue').style.cursor = "nesw-resize";
                var oldTop = element.getBoundingClientRect().top;
                var oldBottom = element.getBoundingClientRect().bottom;
                var oldWidth = element.getBoundingClientRect().width;
                var oldHeight = element.getBoundingClientRect().height;
                var diffWidth = e.pageX - oldWidth - element.getBoundingClientRect().left;
                var diffHeight = e.pageY - element.getBoundingClientRect().top;
                var min = Math.max(diffHeight, diffWidth);
                var newHeight = oldHeight - diffHeight
                if (newHeight < 20)
                    newHeight = 20 * drate;
                element.style.width = newHeight / drate + 'px';
                element.style.height = newHeight + 'px';
                var newBottom = element.getBoundingClientRect().bottom;
                element.style.top = oldTop + (oldHeight - element.getBoundingClientRect().height) + 'px'
            }else if (currentResizer.classList.contains('top-left')) {
                document.querySelector('.theme-blue').style.cursor = "nwse-resize";
                var oldRight = element.getBoundingClientRect().right;
                var oldLeft = element.getBoundingClientRect().left;
                var oldTop = element.getBoundingClientRect().top;
                var oldBottom = element.getBoundingClientRect().bottom;
                var oldWidth = element.getBoundingClientRect().width;
                var oldHeight = element.getBoundingClientRect().height;
                var newWidth = element.getBoundingClientRect().width - e.pageX + element.getBoundingClientRect().left
                var newHeight = element.getBoundingClientRect().bottom - e.pageY
                var diffWidth = newWidth - oldWidth;
                var diffHeight = newHeight - oldHeight;
                var min = Math.max(diffHeight, diffWidth);
                if (min == diffWidth)
                {
                    if (newWidth < 20)
                        newWidth = 20;
                    element.style.width = newWidth + 'px';
                    element.style.height = newWidth * drate + 'px';
                }else
                {
                    if (newHeight < 20)
                        newHeight = 20 * drate;
                    element.style.width = newHeight / drate + 'px';
                    element.style.height = newHeight + 'px';
                }
                var newBottom = element.getBoundingClientRect().bottom;
                element.style.top = oldTop - (newBottom - oldBottom) + 'px'
                var newRight = element.getBoundingClientRect().right;
                element.style.left = oldLeft - (newRight - oldRight) + 'px'
            }else if (currentResizer.classList.contains('bottom-left')) {
                document.querySelector('.theme-blue').style.cursor = "nesw-resize";
                var oldRight = element.getBoundingClientRect().right;
                var oldLeft = element.getBoundingClientRect().left;
                var oldWidth = element.getBoundingClientRect().width;
                var oldHeight = element.getBoundingClientRect().height;
                var newWidth = element.getBoundingClientRect().width - e.pageX + element.getBoundingClientRect().left
                var newHeight = element.getBoundingClientRect().height + e.pageY - element.getBoundingClientRect().bottom
                var diffWidth = newWidth - oldWidth;
                var diffHeight = newHeight - oldHeight;
                var min = Math.min(diffHeight, diffWidth);
                if (min == diffWidth)
                {
                    if (newWidth < 20)
                        newWidth = 20;
                    element.style.width = newWidth + 'px';
                    element.style.height = newWidth * drate + 'px';
                }else
                {
                    if (newHeight < 20)
                        newHeight = 20 * drate;
                    element.style.width = newHeight / drate + 'px';
                    element.style.height = newHeight + 'px';
                }
                var newRight = element.getBoundingClientRect().right;
                element.style.left = oldLeft - (newRight - oldRight) + 'px'
            }
            refresh();
        }
        function stopResize() {
            window.removeEventListener('mousemove', resize)
            document.querySelector('.theme-blue').style.cursor = "auto";
        }
    }
}

