function rotateBase64Image90deg(base64Image, isClockwise) {
    // create an off-screen canvas
    var offScreenCanvas = document.createElement('canvas');
    offScreenCanvasCtx = offScreenCanvas.getContext('2d');

    // cteate Image
    var img = new Image();
    img.src = base64Image;

    // set its dimension to rotated size
    offScreenCanvas.height = img.width;
    offScreenCanvas.width = img.height;

    // rotate and draw source image into the off-screen canvas:
    if (isClockwise) {
        offScreenCanvasCtx.rotate(90 * Math.PI / 180);
        offScreenCanvasCtx.translate(0, -offScreenCanvas.width);
    } else {
        offScreenCanvasCtx.rotate(-90 * Math.PI / 180);
        offScreenCanvasCtx.translate(-offScreenCanvas.height, 0);
    }
    offScreenCanvasCtx.drawImage(img, 0, 0);

    // encode image to data-uri with base64
    return offScreenCanvas.toDataURL("image/jpeg", 100);
}

function previewImage(event) {

    var reader = new FileReader();
	var imgResize = document.querySelector(".resizers");
	var imgTemp = document.createElement("img");
    reader.onload = function(e)
    {
        const element = document.querySelector('.resizable');
        imgTemp.onload = function(){
			imgWidth = imgTemp.width;
			imgHeight = imgTemp.height;
			imgResize.onload = function(){
				console.log(imgWidth + "::" + imgHeight);
				drate = imgHeight / imgWidth;
				var maxValue = Math.max(imgWidth, imgHeight);
				if (maxValue == imgWidth) {
					imgWidth = wMove;
					imgHeight = imgWidth * drate;
				} else {
					imgHeight = hMove;
					imgWidth = imgHeight / drate;
				}
				$(element).css("width", imgWidth);
				$(element).css("height", imgHeight);
				$(element).css("left", (width - imgWidth) / 2);
				$(element).css("display", "block");
				drateresize = 1;
				dloading = 1;
				refresh();
			};
			imgResize.src = e.target.result;
		};
        imgTemp.src = e.target.result;
    }
    reader.readAsDataURL(event.files[0]);
}
