function downloadCanvas(){
    $(document.querySelector("#myCanvas")).attr("width", '1000px');
    $(document.querySelector("#myCanvas")).attr("height", '1000px');
    var c = document.querySelector("#myCanvas");
    var ctx = c.getContext("2d");
    ctx.clearRect(0,0,1000,1000);
    var imgShow = document.getElementById("imgShow");
    ctx.drawImage(imgShow, 0, 0, 1000,1000);
    var imgLogo = document.getElementById("imgLogo");
    ctx.drawImage(imgLogo, 0, 0, 1000,1000);
};

function download() {
    downloadCanvas();
    let canvasImage = document.querySelector('#myCanvas').toDataURL('image/png');

    // this can be used to download any image from webpage to local disk
    let xhr = new XMLHttpRequest();
    xhr.responseType = 'blob';
    xhr.onload = function () {
        let a = document.createElement('a');
        a.href = window.URL.createObjectURL(xhr.response);
        a.download = 'FUCTAPE.jpg';
        a.style.display = 'none';
        document.body.appendChild(a);
        a.click();
        a.remove()
    };
    xhr.open('GET', canvasImage); // This is to download the canvas Image
    xhr.send();
}